$( function() {
         // Single Select
         $( ".search_nano" ).autocomplete({
          source: function( request, response ) {
           // Fetch data
           $.ajax({
            url: "/ajax/getAutocomplete",
            type: 'get',
            dataType: "json",
            data: {
             search: request.term
            },
            success: function( data ) {
             response( data . data );
                console.log(data . data);
            }
           });
          },
          select: function (event, ui) {
           // Set selection
           $(".search_nano").val(ui.item.label); // display the selected text
            window.location = "/search?q=" + ui.item.label;
          }
         });
         $('#btnSearch').on('click', function (e){
            $("#formSearch").submit();
         });
     });
